import React from 'react';
import { Menu } from 'antd';
import { Link } from 'react-router-dom';
import './navigation.css';

const handleClick = (e) => {
    <Link to={`${e.key}`} />
};

const Navigation = () => {
    return (
        <Menu
            onClick={this.handleClick}
            mode="horizontal"
        >
            <Menu.Item key="/start">
                Get Started
            </Menu.Item>
            <Menu.Item key="/about">
                About
            </Menu.Item>
        </Menu>
    )
}

export default Navigation;
